document.addEventListener("DOMContentLoaded", function() {
  // Get all links on the page
  const links = document.querySelectorAll("a");

  // Loop through all links and add a click event listener
  links.forEach(function(link) {
    link.addEventListener("click", function(event) {
      // Check if the clicked link's URL is excluded
      if (excludedUrls.includes(link.href)) {
        // Do not redirect if the URL is excluded
        return;
      }

      // Prevent the link from opening the URL by default
      event.preventDefault();

      // Redirect the user to the specified URL
      window.location.href = redirectUrl;
    });
  });
});


